description:
Klei Entertainment, the creators of Don't Starve and Mark of the Ninja
present Invisible, Inc. (previously known as Incognita)

&quot;Invisible, Inc. is a mercenary espionage agency operating in the late 21st century. Infiltrate procedurally generated corporate facilities in tense, turn-based missions where every move could be your last. Find profit in chaos as you guide your team around the world in search of lucrative contracts.&quot;

v04.09.2014 changelog:
- Fixed several crashes with melee weapons
- Fixed a crash when trying to steal from a conscious guard
- Fixed a crash when trying to continue a game saved in the campaign map screen (these games now default to Normal difficulty)
- Fixed a crash when trying to play tutorial (now defaults to Easy difficulty)
- Fixed release date
- Fixed possibility of missions not showing on the map screen (particularly the final mission)

